export default async function showAccessoriesSelectElement(e,s){try{const e=document.getElementById(`service-cost-${s}`);document.getElementById(`accessories-container-${s}`).classList.toggle("w3-hide",e.options[e.selectedIndex].value.includes("trim"))}catch(e){const{handleError:t}=await import("../../../../../utils/error-messages/handleError.js");t("showAccessoriesSelectElementError","Show accessories select element error: ",e,"We encountered an error. Unable to show accessories at this time.",`accessories-container-${s}`)}}